      <script>function sort_numeric(a, b){ return a - b; }
function sort_string(a, b){ return a.localeCompare(b); }

function grimer_sort(factors, sort_col, sort_mode="numeric", desc=false, group_col1=[], group_col2=[], index=[]) {
    //sort_mode : numeric, string

    // subset data if index provided
    if(index.length){
    	factors = index.map( s => factors[s] );
		sort_col = index.map( s => sort_col[s] );
		if(group_col1.length){
			group_col1 = index.map( s => group_col1[s] );
		}
		if(group_col2.length){
			group_col2 = index.map( s => group_col2[s] );
		}
    }

    // Generate numerical index to sort arrays
    var idx = new Array(factors.length);
    for (var i = 0; i < idx.length; ++i) idx[i] = i;
    //If numeric, replace NaN with sortable value (-Infinity) to be at the end of the sorted array
	if (sort_mode=="numeric"){
		sort_col = sort_col.map(function(v){ return isNaN(v) ? -Infinity : v })
	}

	if(group_col1.length && group_col2.length){
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[b],sort_col[a]));
	}else if(group_col1.length){
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[b],sort_col[a]));
	}else{
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(sort_col[b],sort_col[a]));
	}

    var sorted_factors = new Array(idx.length);
    for (var i = 0; i < idx.length; ++i) sorted_factors[i] = factors[idx[i]];
    return sorted_factors;
}

      var factors = [];\n        var sorted_factors = [];\n\n        // get index of selected indices\n        var selected_indices = cds_p_sampletable.selected.indices;\n\n        if(selected_indices.length){\n            // samples\n            var annot_samples = cds_d_samples.data[\"index\"];\n\n            // Define value from Sort by select\n            var sort_col;\n            if (sort_select.value==\"input_order\"){\n                sort_col = cds_d_samples.data[\"aux|input_order\"];\n            }else if (sort_select.value.startsWith(\"metadata_num|\")){\n                sort_col = cds_d_metadata.data[sort_select.value.replace('metadata_num|','')];\n                // Annotate label with value\n                var annot_samples = annot_samples.map(function(s, i) {\n                  return sort_col[i] + \" | \" + s;\n                });\n            }else if (sort_select.value.startsWith(\"col|\")){\n                sort_col = cds_p_obsbars.data[sort_select.value.replace('col|','')];\n            }\n\n            // If group by is selected, use as first sort factor\n            if(groupby1_select.value!=\"none\"){\n                var groupby_col1 = cds_d_metadata.data[groupby1_select.value.replace('metadata_cat|','')];\n\n                // Zip sample index and metadata field to create nested factors\n                factors = groupby_col1.map(function(m, i) {\n                  return [m, annot_samples[i]];\n                });\n\n                // second grouping level\n                if(groupby2_select.value!=\"none\" &amp;&amp; groupby2_select.value!=groupby1_select.value){\n\n                    var groupby_col2 = cds_d_metadata.data[groupby2_select.value.replace('metadata_cat|','')];\n\n                    factors = groupby_col2.map(function(m, i) {\n                      return [groupby_col1[i], m, annot_samples[i]];\n                    });\n\n                    // only selected_indices\n                    sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false, groupby_col2, groupby_col1, selected_indices);\n                }else{\n                    sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false, groupby_col1, [], selected_indices);\n                }\n\n            }else{\n                // Single factors, just use the sample index\n                factors = annot_samples;\n                sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false, [], [], selected_indices);\n            }\n\n            // Change value of the factors on the obsbars cds\n            cds_p_obsbars.data[\"factors\"] = factors;\n        }\n\n        // Plot sorted factors\n        obsbars.x_range.factors = sorted_factors;\n        "},"id":"2205","type":"CustomJS"},{"attributes":{"high":27,"low":0,"palette":["#30123b","#3a2c79","#4148b0","#4563d9","#467df4","#4096fe","#33acf6","#21c4e1","#17d9c7","#1ee8af","#38f491","#59fb72","#80fe53","#a1fc3d","#bbf434","#d4e735","#e7d738","#f6c23a","#fdab33","#fd8f28","#f7711b","#ee5810","#e04008","#ce2d04","#b61c01","#9a0e01","#7a0402"]},"id":"1760","type":"LinearColorMapper"},{"attributes":{"label":{"value":"direct"},"renderers":[{"id":"1167"}]},"id":"1178","type":"LegendItem"},{"attributes":{"color_mapper":{"id":"1756"},"formatter":{"id":"2321"},"label_standoff":1,"location":[0,0],"major_label_overrides":{"0.5":"0","1.5":"1","10.5":"3","11.5":"303.01","12.5":"312.01","13.5":"34.01","14.5":"345.02","15.5":"Female","16.5":"Male","2.5":"107.01","3.5":"107.02","4.5":"120.01","5.5":"184.01","6.5":"190.01","7.5":"244.01","8.5":"278.01","9.5":"286.02"},"major_label_text_align":"left","major_label_text_font_size":"9px","ticker":{"id":"1757"},"title":"Sex","title_text_font_size":"11px","visible":false,"width":10},"id":"1755","type":"ColorBar"},{"attributes":{"bottom":{"expr":{"id":"2013"}},"fill_alpha":{"value":0.1},"fill_color":{"value":"#98df8a"},"line_alpha":{"value":0.1},"line_color":{"value":"#98df8a"},"top":{"expr":{"id":"2014"}},"width":{"valu col, \"numeric\", false, groupby_col1);\n            }\n\n        }else{\n            // Single factors, just use the sample index\n            factors = annot_samples;\n            sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false);\n        }\n\n        // Change value of the factors on the samplebars cds\n        cds_p_samplebars.data[\"aux|factors\"] = factors;\n\n        // Plot sorted factors\n        samplebars.x_range.factors = sorted_factors;\n        "},"id":"2185","type":"CustomJS"},{"attributes":{},"id":"2311","type":"BasicTickFormatter"},{"attributes":{"js_property_callbacks":{"change:indices":[{"id":"2186"},{"id":"2187"},{"id":"2185"},{"id":"2189"},{"id":"2190"},{"id":"2191"},{"id":"2192"}]}},"id":"2194","type":"Selection"},{"attributes":{},"id":"2312","type":"BasicTickFormatter"},{"attributes":{"args":{"active_ranks":["superkingdom","phylum","class","order","family","genus","species"],"cds_m_obstable":{"id":"1001"},"cds_p_references":{"id":"1003"},"references_fig":{"id":"1132"},"references_filter":{"id":"1157"},"references_select":{"id":"1194"}},"code":"\n        // selected row\n        const row = cds_m_obstable.selected.indices[0];\n        const indices = [];\n        if (row!=undefined){\n            for(let i = 0; i &lt; cds_p_references.length; i++){\n                // for each rank\n                for(let r = 0; r &lt; active_ranks.length; r++){\n                    // get taxid of the rank\n                    let rank_obs = cds_m_obstable.data[\"tax|\"+active_ranks[r]][row];\n                    if(cds_p_references.data[\"obs\"][i]==rank_obs &amp;&amp;\n                       cds_p_references.data[\"rank\"][i]==active_ranks[r] &amp;&amp;\n                       cds_p_references.data[\"ref\"][i]==references_select.value){\n                        indices.push(i);\n                    }\n                }\n            }\n        }\n        references_filter.indices = indices;\n        cds_p_references.change.emit();\n lue;\n\n        // get index to access data from observations from cds_m_obstable\n        var obs_index = [];\n        for (let i = 0; i &lt; cds_m_obstable.data[\"index\"].length; i++) {\n            if(cds_m_obstable.data[\"col|rank\"][i]==rank){\n                obs_index.push(i);\n            }\n        }\n\n        var annot_obs = obs_index.map( s =&gt; cds_m_obstable.data[\"index\"][s] );\n\n        var sorted_factors = [];\n        var dict_factors = {};\n        if (x_groupby_select.value.startsWith(\"cluster|\")){\n            // Default dict_factors\n            for(let i = 0; i &lt; annot_obs.length; i++){\n                dict_factors[annot_obs[i]] = annot_obs[i];\n            }\n            // Clustering - Get sorted elements based on rank|method|metric\n            sorted_factors = dict_d_hcluster_x[rank+\"|\"+x_groupby_select.value.replace(\"cluster|\",\"\")];\n        }else{\n            // Define value from Sort by select\n            var sort_col = [];\n            var sort_col_type = \"numeric\";\n            if (x_sort_select.value==\"none\"){\n                sort_col = obs_index;\n            }else if (x_sort_select.value==\"observations\"){\n                sort_col = obs_index.map( s =&gt; cds_m_obstable.data[\"col|name\"][s] );\n                sort_col_type = \"string\";\n            }else if (x_sort_select.value==\"counts\"){\n                sort_col = obs_index.map( s =&gt; cds_m_obstable.data[\"col|total_counts\"][s] );\n            }else if (x_sort_select.value.startsWith(\"annot|\")){\n                const annot = x_sort_select.value.replace(\"annot|\",\"\");\n                // create array with zeros, mark with one if annotation is present\n                sort_col = new Array(annot_obs.length); for (let i=0; i&lt;annot_obs.length; ++i) sort_col[i] = NaN;\n                for (let i = 0; i &lt; cds_p_annotations.data[\"index\"].length; i++) {\n                    if (cds_p_annotations.data[\"rank\"][i]==rank &amp;&amp; cds_p_annotations.data[\"annot\"][i]==annot) {\n                        sort_col[annot_obs.indexOf(cds_p_annotations.data[\"index\"][i])] = cds_p_annotations.data[\"tv\"][i];\n                    }\n                }\n            }\n\n            if(x_groupby_select.value==\"none\"){\n                // Default dict_factors\n                for(let i = 0; i &lt; annot_obs.length; i++){\n                    dict_factors[annot_obs[i]] = annot_obs[i];\n                }\n                sorted_factors = grimer_sort(annot_obs, sort_col, sort_col_type, false);\n            }else if (x_groupby_select.value.startsWith(\"tax|\")){\n                const group_rank = x_groupby_select.value.replace(\"tax|\",\"\");\n                // if grouping with a higher rank\n                if(active_ranks.indexOf(rank) &gt; active_ranks.indexOf(group_rank)){\n                    // group entries without selected rank with space \" \"\n                    var groupby_col = obs_index.map(function(s) { return cds_m_obstable.data[\"tax|\" + group_rank][s] == \"\" ? \" \" : dict_d_taxname[cds_m_obstable.data[\"tax|\" + group_rank][s]]; });\n                    var factors = [];\n                    for(let i = 0; i &lt; annot_obs.length; i++){\n                        dict_factors[annot_obs[i]] = [groupby_col[i], annot_obs[i]];\n                        factors.push([groupby_col[i], annot_obs[i]]);\n                    }\n                    sorted_factors = grimer_sort(factors, sort_col, sort_col_type, false, groupby_col);\n                }else{\n                    // Default dict_factors\n                    for(let i = 0; i &lt; annot_obs.length; i++){\n                        dict_factors[annot_obs[i]] = annot_obs[i];\n                    }\n                    // normal sort\n                    sorted_factors = grimer_sort(annot_obs, sort_col, sort_col_type, false);\n                }\n            }\n        }\n\n        // update factors on heatmap col otherwise remove\n        for (let i = 0 ation for contamination is when the dots (excluding control samples) \"fit\" the red line model.&lt;/p&gt;&lt;p&gt;The P-score statistic is not a P-value and it is not associated with any guarantees on the type 1 error rate [1]. Small scores indicate the contaminant model is a better fit, and high scores indicate that the non-contaminant model is a better fit.&lt;/p&gt;&lt;p&gt;More details can be found in the &lt;a target=\"_blank\" href=\"https://benjjneb.github.io/decontam/vignettes/decontam_intro.html\"&gt;DECONTAM Introduction guide&lt;/a&gt;&lt;/p&gt;&lt;p&gt;[1] Davis, N. M. et al. Simple statistical identification and removal of contaminant sequences in marker-gene and metagenomics data. Microbiome (2018) 10.1186/s40168-018-0605-2.&lt;/p&gt;');"},"id":"1309","type":"CustomJS"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#66a61e"},"line_alpha":{"value":0.1},"line_color":{"value":"navy"},"size":{"units":"screen","value":7},"x":{"field":"aux|factors"},"y":{"field":"tax|family"}},"id":"1381","type":"Scatter"},{"attributes":{"factors":["SRS1267685.SRR3131402","SRS1267687.SRR3131440","SRS1267690.SRR3131445","SRS1267691.SRR3131437","SRS1267693.SRR3131393","SRS1267698.SRR3131452","SRS1267699.SRR3131480","SRS1267700.SRR3131450","SRS1267701.SRR3131481","SRS1267702.SRR3131401","SRS1267704.SRR3131428","SRS1267705.SRR3131424","SRS1267706.SRR3131482","SRS1267708.SRR3131507","SRS1267709.SRR3131506","SRS1267710.SRR3131505","SRS1267711.SRR3131504","SRS1267712.SRR3131503","SRS1267713.SRR3131502","SRS1267714.SRR3131501","SRS1267715.SRR3131500","SRS1267717.SRR3131498","SRS1267718.SRR3131497","SRS1267719.SRR3131496","SRS1267721.SRR3131493","SRS1267722.SRR3131492","SRS1267723.SRR3131491","SRS1267725.SRR3131489","SRS1267726.SRR3131488","SRS1267727.SRR3131486","SRS1267728.SRR3131485","SRS1267729.SRR3131484","SRS1267730.SRR3131483","SRS1267731.SRR3131479","SRS1267732.SRR3131477","SRS1267733.SRR3131476","SRS1267734.SRR3131475","SRS1267735.SRR3131474","SRS1267736.
